    <div className="flex flex-row justify-center">
      <div className={styles.heroImg} />
      <Link href="/">
        <a className="transition transition-colors duration-300 hover:text-blue-800 text-blue-500 text-lg tracking-wider cursor-pointer">
          Melvin George
